const themes = (props) => {
    const style = {
        firstContainer: {
            backgroundColor: 'rgb(127, 190, 174)',
            margin: '0px 2px',
            height: '550px',
            width: '30%',
        },
        secondContainer: {
            backgroundColor: 'rgb(127, 190, 174)',
