            height: '550px',
            width: '15%',
        },
        thirdContainer: {
            backgroundColor: 'rgb(127, 190, 174)',
            margin: '0px 2px',
            height: '550px',
            width: '30%',
        },
        fourthContainer: {
            backgroundColor: 'rgb(55, 86, 157)',
            margin: '0px 2px',
            height: '550px',
            width: '25%',
        }
    }
    return (        
      <div className={classes.themes}>
          <div className={classes.modalMiddle}>
            <div className={classes.sectionTitle}>
            <p style={{color: 'rgb(147, 147, 147)', fontWeight: 'bold'}}><span style={{color: 'black'}}>À la maison,</span> qu’est-ce qui m’entoure dans mon appartement ?</p>
            </div>
            <div className={classes.fullWidthContainer}>
            <div style={style.firstContainer}></div>
            <div style={style.secondContainer}></div>
            <div style={style.thirdContainer}></div>
            <div style={style.fourthContainer}></div>
            </div>
        </div>
      </div>
    );
}

export default Radium(themes);
